class Resultados extends Component{
    render(){
        return(
            <div id="materiales">
            <iframe className="col-12" title="Resultados" src="https://datastudio.google.com/embed/reporting/ab6eea7d-0754-4d6b-92fc-0188d998b5d1/page/72F5" frameborder="0"  AllowFullScreen></iframe>
            </div>
        )
    }
}
export default Resultados;
